  input: 'TEXT,F3A,,"Notes and Explanations:  with respect to the excess contribution,
    a hard-copy letter was prepared and mailed along with some supporting documents
    to Ms. Sally R. Bacon to fully explain the reasoning behind the inadvertent errors.  With
    respect to the cash balance, the returned check of $1,000 on 09/05/06 is now reflected
    in the 09/04/06-09/30/06 report. In addition, this amended report also fixed the
    problem on the cash balance that was in question. With respect to the 48-Hour
    Notices, there were 2 reports that were submitted electronically on-time.  However,
    after checking the submitted data set, it appears that only the face sheets were
    submitted electronically.  The treasurer suspects that electronic transmission
    error was the factor of this problem.  Unfortunately, the treasurer did not get
    prompted by the system that error had occurred during those transmission periods.
    With respect to the disclosure of receipts on both lines 11(a)(i) and 11(d). This
    was also an inadvertent error. Corrections were made accordingly.  With respect
    to Schedule B, Line 17, the only changes that were made were the explanations
    that these are all expense reimbursements. Changes were also made for the following:
    under Ron Menor, $4,820 dated 9/25/06, allocated to 23 individual contributors,
    $1,000 dated 09/25/06, allocated to 5 individual contributors, $175 dated 9/27/06
    to PAC."'
